import React, { Component } from 'react';
import './styles.css';

//images
import image1 from '../images/main_login.png';

export class Home extends Component {
  static displayName = Home.name;
  render () {
    return (
        <div>
            <img className="img-home-main" src={image1} />
        </div>
    );
   }
}
